import styled from "styled-components";

const Button = ({ type, children }) => {
  switch (type) {
    case "Big":
      return Big;
      break;
    case "Small":
      return Small;
      break;
    default:
      return <Small>{children}</Small>;
  }
};

const Small = styled.button``;

const Big = styled.button``;

export default Button;
